import React, { useState } from 'react';
import Home from './home';
import Play from './play';
import Highscore from './highscore';

export default function Main() {
  const [view, setView] = useState('home' as any);
  const [mode, setMode] = useState('add' as any);
  const [newScore, setNewscore] = useState(0 as any);
  const [isNewHighscore, setIsNewHighScore] = useState(false);

  let element = null;
  switch (view) {
    case 'play':
      element = (
        <Play setIsNewHighScore={setIsNewHighScore} setView={setView} />
      );
      break;
    case 'highscore':
      element = (
        <Highscore
          mode={mode}
          isNewHighscore={isNewHighscore}
          setView={setView}
        />
      );
      break;
    default:
      element = <Home setView={setView} />;
  }
  return <>{element}</>;
}
